import React from "react";
import Sidebar from "../components/sidebar";

export default class Project extends React.Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <Sidebar />
          <div className="col-sm-9 whiteCarryover"></div>
        </div>
      </div>
    );
  }
}
